var settings = {
  active: '',

  /**
   * @description 网站标题
   */
  title: '指标管理平台',

  /**
   * @description 是否显示 tagsView
   */
  tagsView: true,

  /**
   * 是否显示面包屑
   */
  showBreadcrumb: true,

  /**
   * @description 固定头部
   */
  fixedHeader: true,

  /**
   * @description 记住密码状态下的token在Cookie中存储的天数，默认1天
   */
  tokenCookieExpires: 1,

  /**
   * @description 记住密码状态下的密码在Cookie中存储的天数，默认1天s
   */
  passCookieExpires: 1,

  /**
   * @description 是否只保持一个子菜单的展开
   */
  uniqueOpened: true,

  /**
   * @description token key
   */
  TokenKey: 'EL-ADMIN-TOEKN',

  /**
   * @description 请求超时时间，毫秒（默认2分钟）
   */
  timeout: 1200000,

  /**
   * @description 是否显示logo
   */
  sidebarLogo: true,

  /**
   * logo 图标
   */
  logo: '/images/logo.png',

  /**
   * 默认主题
   */
  defaultTheme: {
    style: 'golden'
  },
  showThemeSelect: false,

  /**
   * smartbi 登录方式 0：不集成，1:loginToken，2：jsloader
   */
  smartbiLogin: 1,

  /**
   * 是否显示设置的底部信息
   */
  showFooter: false,

  /**
   * 底部文字，支持html语法
   */
  // footerTxt: '© 2019 Zheng Jie <a href="http://www.apache.org/licenses/LICENSE-2.0" target="_blank">Apache License 2.0</a>',
  footerTxt: '© 2019 Pactera Technology International Ltd',

  /**
   * 备案号
   */
  caseNumber: 'All rights reserved'
};
